import React, {Component} from 'react';
import './header.scss';

export default class Header extends Component{
    render(){
        return (
            <header>
                <div className="container text-header">
                    <h1>Cindy Buchet</h1>
                    <p>Je suis web developpeuse</p>
                </div>
            </header>
        );
    }
}
